import React from 'react';
import { SubHeading } from '../../components';
import { assets } from '../../material';
import './header.css';

const Header = () => (
  <div className="app_header app_wrapper section_padding" id="home">
    <div className="app_wrapper_info">
      <SubHeading title="Chase the new flavour" />
      <h1 className="app_header-h1">Nothing Brings People Together Like Our Food and Drinks</h1>
      <p className="p_opensans" style={{ margin: '2rem 0' }}>  nllus </p>
      <button type="button" className="custom_button">Explore Menu</button>
    </div>

    <div className="app_wrapper_img">
      <img src={assets.food} alt="header_img" />
    </div>
  </div>

);

export default Header;
